// LoadPlanCandidatePlacesByPage performs eager loading of values by page. This is for a 1-M or N-M relationship.
func (s PlanCandidateSlice) LoadPlanCandidatePlacesByPage(ctx context.Context, e boil.ContextExecutor, mods ...qm.QueryMod) error {
	return s.LoadPlanCandidatePlacesByPageEx(ctx, e, DefaultPageSize, mods...)
}
func (s PlanCandidateSlice) LoadPlanCandidatePlacesByPageEx(ctx context.Context, e boil.ContextExecutor, pageSize int, mods ...qm.QueryMod) error {
	if len(s) == 0 {
		return nil
	}
	for _, chunk := range chunkSlice[*PlanCandidate](s, pageSize) {
		if err := chunk[0].L.LoadPlanCandidatePlaces(ctx, e, false, &chunk, queryMods(mods)); err != nil {
			return err
		}
	}
	return nil
}

func (s PlanCandidateSlice) GetLoadedPlanCandidatePlaces() PlanCandidatePlaceSlice {
	result := make(PlanCandidatePlaceSlice, 0, len(s)*2)
	for _, item := range s {
		if item.R == nil || item.R.PlanCandidatePlaces == nil {
			continue
		}
		result = append(result, item.R.PlanCandidatePlaces...)
	}
	return result
}

